function Carrosel() {
  return (
  <>


	<div className="underline-box ready" style={{marginTop: "35px", textAlign: "center"}}>
		<h1 className="rising-reveal"><span className="letter">B</span><span className="letter">O</span><span className="letter">L</span><span className="letter">O</span><span className="letter">S</span></h1>
		<p>Deliciosamente recheados e com muito sabor, cada um de nossos bolos é criado <br/> para proporcionar mais amor e carinho para todas as ocasiões.</p>
	</div>


  </>
  );
}

export default Carrosel;
